function go(){var e=document.getElementById("prj-input-1").files[0];(new JSZip).loadAsync(e,{checkCRC32:!0,createFolders:!0}).then(function(e){e.file("INSTRUCTIONS.md").async("string").then(function(e){document.getElementById("_instructions").innerHTML=marked(e)},function(e){halfmoon.initStickyAlert({content:e,title:"error getting instructions",alertType:"alert-danger"})}),e.file("OBJECT.json").async("string").then(function(e){var n=JSON.parse(e);document.getElementById("info-title").innerHTML=n.title,document.getElementById("info-description").innerHTML=n.description,n.price=n.priceformat+n.price[0]+" - "+n.priceformat+n.price[1],document.getElementById("info-price").innerHTML=n.price,document.getElementById("info-date").innerHTML=n.date},function(e){halfmoon.initStickyAlert({content:e,title:"error getting info",alertType:"alert-danger"})}),e.folder("images").forEach(function(n,t){console.log("images/"+n),e.file("images/"+n).async("base64").then(function(e){var n='<img src="data:image/png;base64,'+e+'"></img><br>';document.getElementById("_images").innerHTML+=n},function(e){halfmoon.initStickyAlert({content:e,title:"error getting images",alertType:"alert-danger"})})})},function(e){halfmoon.initStickyAlert({content:e,title:"error reading file",alertType:"alert-danger"})})}